-- Create table 菜单表
create table sys_menu_dict
(
   id                   varchar(64) not null comment '主键',
   parent_id            varchar(64) not null comment '父级菜单',
   parent_ids           varchar(2000) comment '所有父级编号',
   name                 varchar(20) not null comment '菜单名称',
   href                 varchar(100) not null comment '菜单连接',
   target               varchar(20) comment '打开方式',
   icon                 varchar(50) comment '菜单图标路径',
   is_show              char(1) comment '是否显示',
   sort                 int comment '菜单排序',
   permission           varchar(1000) comment '权限标识',
   del_flag             char(1) comment '标志',
   create_by            varchar(64) comment '创建人',
   create_date          datetime comment '创建时间',
   update_by            varchar(64) comment '更新人',
   update_date          datetime comment '更新时间',
   remarks              varchar(500) comment '备注信息',
   primary key (id)
);

alter table sys_menu_dict comment '菜单字典表-sys_menu_dict';






